import React from 'react';
import {
  Box,
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  CardMedia,
  Button,
  IconButton,
  Paper,
  Chip,
  Tooltip,
} from '@mui/material';
import {
  Delete as DeleteIcon,
  ShoppingCart,
  Favorite,
  LocalShipping,
  Verified,
} from '@mui/icons-material';
import { useNavigate } from 'react-router-dom';
import { useProduct } from '../context/ProductContext';

const Wishlist = () => {
  const navigate = useNavigate();
  const { wishlist, removeFromWishlist, moveToCart, getCategoryInfo } = useProduct();

  return (
    <Box sx={{ py: 6, minHeight: '100vh' }}>
      <Container>
        <Typography
          variant="h3"
          component="h1"
          align="center"
          gutterBottom
          sx={{
            fontWeight: 700,
            background: 'linear-gradient(45deg, #FF6B6B 30%, #FF9E00 90%)',
            WebkitBackgroundClip: 'text',
            WebkitTextFillColor: 'transparent',
            mb: 6,
          }}
        >
          Your Cosmic Wishlist
        </Typography>

        {wishlist.length === 0 ? (
          <Box
            sx={{
              textAlign: 'center',
              py: 8,
            }}
          >
            <Favorite sx={{ fontSize: 64, color: '#FF6B6B', mb: 2 }} />
            <Typography variant="h5" gutterBottom sx={{ color: '#FF6B6B' }}>
              Your wishlist is empty
            </Typography>
            <Typography variant="body1" color="text.secondary" paragraph>
              Discover amazing telescopes and space merchandise to add to your wishlist
            </Typography>
            <Button
              variant="contained"
              onClick={() => navigate('/')}
              sx={{
                minWidth: 200,
              }}
            >
              Explore Products
            </Button>
          </Box>
        ) : (
          <Grid container spacing={4}>
            {wishlist.map((item) => {
              const categoryInfo = getCategoryInfo(item.price);
              return (
                <Grid item xs={12} sm={6} md={4} key={item.id}>
                  <Card
                    sx={{
                      height: '100%',
                      display: 'flex',
                      flexDirection: 'column',
                      position: 'relative',
                      transition: 'transform 0.2s',
                      '&:hover': {
                        transform: 'translateY(-4px)',
                      },
                      '&::before': {
                        content: '""',
                        position: 'absolute',
                        top: 0,
                        left: 0,
                        right: 0,
                        height: '4px',
                        background: `linear-gradient(90deg, ${categoryInfo.color}, ${
                          categoryInfo.color === '#FF6B6B' ? '#FF9E00' : '#4CDFFF'
                        })`,
                      },
                    }}
                  >
                    <Box sx={{ position: 'relative' }}>
                      <CardMedia
                        component="img"
                        image={item.image}
                        alt={item.name}
                        sx={{
                          height: 200,
                          objectFit: 'cover',
                        }}
                      />
                      <Chip
                        label={categoryInfo.label}
                        sx={{
                          position: 'absolute',
                          top: 8,
                          right: 8,
                          bgcolor: categoryInfo.color,
                          color: 'white',
                          fontSize: '0.75rem',
                        }}
                      />
                    </Box>

                    <CardContent sx={{ flexGrow: 1 }}>
                      <Typography variant="h6" gutterBottom>
                        {item.name}
                      </Typography>
                      <Typography variant="body2" color="text.secondary" paragraph>
                        {item.description}
                      </Typography>
                      <Box sx={{ display: 'flex', gap: 1, mb: 2 }}>
                        <Chip
                          size="small"
                          icon={<LocalShipping sx={{ fontSize: '1rem' }} />}
                          label="Free Shipping"
                          sx={{
                            bgcolor: 'rgba(0, 245, 212, 0.1)',
                            color: '#00F5D4',
                            borderColor: '#00F5D4',
                          }}
                        />
                        <Chip
                          size="small"
                          icon={<Verified sx={{ fontSize: '1rem' }} />}
                          label="Genuine Product"
                          sx={{
                            bgcolor: 'rgba(0, 182, 241, 0.1)',
                            color: '#00B6F1',
                            borderColor: '#00B6F1',
                          }}
                        />
                      </Box>
                      <Box
                        sx={{
                          display: 'flex',
                          justifyContent: 'space-between',
                          alignItems: 'center',
                        }}
                      >
                        <Typography variant="h6" sx={{ fontWeight: 600 }}>
                          ₹{item.price.toLocaleString()}
                        </Typography>
                        <Box>
                          <Tooltip title="Move to Cart">
                            <IconButton
                              onClick={() => moveToCart(item.id)}
                              sx={{
                                color: '#00B6F1',
                                mr: 1,
                                '&:hover': {
                                  bgcolor: 'rgba(0, 182, 241, 0.1)',
                                },
                              }}
                            >
                              <ShoppingCart />
                            </IconButton>
                          </Tooltip>
                          <Tooltip title="Remove from Wishlist">
                            <IconButton
                              onClick={() => removeFromWishlist(item.id)}
                              sx={{
                                color: '#FF6B6B',
                                '&:hover': {
                                  bgcolor: 'rgba(255, 107, 107, 0.1)',
                                },
                              }}
                            >
                              <DeleteIcon />
                            </IconButton>
                          </Tooltip>
                        </Box>
                      </Box>
                    </CardContent>
                  </Card>
                </Grid>
              );
            })}
          </Grid>
        )}
      </Container>
    </Box>
  );
};

export default Wishlist;
